var setCookie = {

    b: $('body'),
    h: $('#header'),
    s: $('#sidebar'),

    show: function() {
        $('.cookie').css("display", "block");
    },
    hide: function() {
        $('.cookie').css("display", "none");
        // bug sidebar expanded and click on cookie
        if ($('#sidebar').hasClass('expanded')) {
            $('#sidebar').show()
        }
    },
    close: function() {
        this.hide();
        this.init();
        //Cookies.set('ucg_cookie_disclaimer', 'YH', { expires: 180, domain: 'www.unicreditgroup.eu' });
        Cookies.set('claw_ucg_enable', 'YH', { expires: 180, domain: this.getDomain() });
    },
    technical: function() {
        this.hide();
        this.init();
        //Cookies.set('ucg_cookie_disclaimer', 'N0', { expires: 180, domain: 'www.unicreditgroup.eu' });
        Cookies.set('claw_ucg_enable', 'NH', { expires: 180, domain: this.getDomain() });
    },
    init: function() {
        if( this.isEditDomain() ) {
            this.show();
            // Cookies.remove('ucg_cookie_disclaimer', { domain: 'www.unicreditgroup.eu' });
            // Cookies.remove('claw_ucg_enable');
        } else {
            var claw_uci_enable = Cookies.get('claw_ucg_enable');
            if (claw_uci_enable == undefined || (claw_uci_enable != 'YH' && claw_uci_enable != 'NH' && claw_uci_enable != 'Y1' && claw_uci_enable != 'Y0')) {
            this.show();
            } else {
                this.hide();
            }
        }
    },
    getDomain: function() {
        var domainValue = window.location.hostname.split('.').slice(-2).join('.') || "unicredit.it";
        //domainValue = 'www.unicreditgroup.eu';
        return domainValue;
    },
    isEditDomain: function() {
        var loc = window.parent.location;
        return loc.hostname.indexOf("aem") === 0 || loc.href.indexOf("editor.html") !== -1 || loc.href.indexOf("cf#") !== -1;
    }
};

// close and set cookie on click to accept link and set YH
$(document).off("click", "#cookieAccepted");
$(document).on('click ', '#cookieAccepted', function() {
    setCookie.close();
});

// set storage to  N0
$(document).off("click", "#cookieDeclined");
$(document).on('click ', '#cookieDeclined', function() {
    setCookie.technical();
});

$(function() {
    setCookie.init();
});


