UCGN.fn.detectBrowserType = function(){
	$.browserDetect.init();
	if ("ontouchstart" in document.documentElement) {
		if(document.documentElement.className.indexOf(" touch")==-1){
			document.documentElement.className += " touch";
		}
	} else {
		if(document.documentElement.className.indexOf(" no-touch")==-1){
			document.documentElement.className += " no-touch";
		}
	}
};

UCGN.fn.closeDisclaimerWithRedirect = function(url, target){
	var closeBtn = $(".ucg_disclaimer button.close");
	if(closeBtn.length>0){
		closeBtn[0].click();
	}
	
	var msie = window.navigator.userAgent.indexOf("MSIE ");
	var isIE = msie > -1 || navigator.userAgent.match(/Trident.*rv:11\./); 
	if(target=="_blank" && !isIE){
		//console.log("_blank");
		link = document.createElementNS("http://"+"www.w3.org/1999/xhtml", "a");
	    link.href = url;
	    link.target = '_blank';
	    var event;
	    if(document.createEvent){
	    	event = document.createEvent("MouseEvent");
			event.initEvent("click",true,true);
    	}else{
			event = new MouseEvent('click', {
						'view': window,
						'bubbles': true,
						'cancelable': true
					});
		}
	    link.dispatchEvent(event);
	}else{
		//console.log("_self");
		window.location.href = url;
	}
};
//detect bootstrap breakpoint
function isBreakpoint(alias) {
	// Innietto nel contenitore i div che servono per fare il check
	if ($(".device-xs.visible-xs").length == 0) {
		$("body").append($("<div class=\"device-xs visible-xs\"></div>"))
				.append($("<div class=\"device-sm visible-sm\"></div>"))
				.append($("<div class=\"device-md visible-md\"></div>"))
				.append($("<div class=\"device-lg visible-lg\"></div>"));
	}
	return $('.device-' + alias).is(':visible');
}
