//Fixa l'assenza di filter in IE8
if (!Array.prototype.filter)
{
  Array.prototype.filter = function(fun /*, thisp */)
  {
    "use strict";

    if (this === void 0 || this === null)
      throw new TypeError();

    var t = Object(this);
    var len = t.length >>> 0;
    if (typeof fun !== "function")
      throw new TypeError();

    var res = [];
    var thisp = arguments[1];
    for (var i = 0; i < len; i++)
    {
      if (i in t)
      {
        var val = t[i]; // in case fun mutates this
        if (fun.call(thisp, val, i, t))
          res.push(val);
      }
    }

    return res;
  };
}

//prototyping endsWith for IE
if (!String.prototype.endsWith) {
  String.prototype.endsWith = function(searchString, position) {
      var subjectString = this.toString();
      if (typeof position !== 'number' || !isFinite(position) || Math.floor(position) !== position || position > subjectString.length) {
        position = subjectString.length;
      }
      position -= searchString.length;
      var lastIndex = subjectString.indexOf(searchString, position);
      return lastIndex !== -1 && lastIndex === position;
  };
}

function DisclaimerMap(){
	var name = UCGN.Constant.DISC_MAP_NAME + "=";
    var ca = document.cookie.split(';');
    var tmp = "";
    for(var i=0; i<ca.length; i++) {
        var c = ca[i];
        while (c.charAt(0)==' ') { c = c.substring(1); }
        if (c.indexOf(name) == 0){ tmp = c.substring(name.length, c.length) };
    }
    if(tmp === "") {
    	tmp = {};
    }
    this.map = typeof tmp == "object" ? tmp : JSON.parse(tmp);

    // console.group("DisclaimerMap");
    // console.log(this.map);
    // console.groupEnd();
}

DisclaimerMap.prototype.addAcceptation = function(path){
	if(path.indexOf(UCGN.Constant.DAM_ROOT_PATH)==-1){
		var d = new Date();
		this.map[path] = d.getTime() + (UCGN.Constant.DISC_ACCEPT_EXPIRATION*60*60*1000);
		d.setTime(d.getTime() + (UCGN.Constant.DISC_MAP_EXPIRATION*60*60*1000));
		var expires = "expires="+d.toUTCString();
		//var isSecure = window.location.protocol == "https://" ? true : false;
		document.cookie = UCGN.Constant.DISC_MAP_NAME + "=" + JSON.stringify(this.map) + "; " + expires + "; path=/";   // secure="+isSecure;
	}
    // console.group("addAcceptation");
    // console.log(this.map);
    // console.groupEnd();
}

DisclaimerMap.prototype.removeAcceptation = function(path){
	if(this.isAccepted(path)){
		delete this.map[path];
		var d = new Date();
		d.setTime(d.getTime() + (UCGN.Constant.DISC_MAP_EXPIRATION*60*60*1000));
		var expires = "expires="+d.toUTCString();
		//var isSecure = window.location.protocol == "https://" ? true : false;
		document.cookie = UCGN.Constant.DISC_MAP_NAME + "=" + JSON.stringify(this.map) + "; " + expires + "; path=/";   //; secure="+isSecure;
	}
    // console.group("removeAcceptation ");
    // console.log(this.map);
    // console.groupEnd();
}

DisclaimerMap.prototype.isAccepted = function(path){
	// console.group("isAccepted");
	// console.log(this.map);
	// console.groupEnd();
	if(this.map.hasOwnProperty(path)){
		var d = new Date();
		if( ( d.getTime() - this.map[path] ) < UCGN.Constant.DISC_ACCEPT_EXPIRATION*60*60*1000 ){
			return true
		}
	}
	return false;
}
