		_appendSuggestions: function(wordsList, userInput){
			var suggestionsHTML = wordsList.reduce(function(accSuggestions, word, index){
				var wordAfterUserInput = word.substring(userInput.length);
				return accSuggestions += '<div class="autocomplete-suggestion" data-index="'+ index +'"><strong>'+userInput+'</strong>'+ wordAfterUserInput +'</div>'
			}, '');

			$('.searchSuggestion').empty();

			if( suggestionsHTML ){
				$('.searchSuggestion').html('<div class="autocomplete-suggestions">'+ suggestionsHTML +'</div>');
			}
		},
		
