var initUCGDisclaimer = function (){
	UCGN.disclaimerMatchingJSON = "{}";
	$.ajax({
		url: UCGN.Constant.DISCLAIMER_MAP_FILE+"/jcr:content/jcr:data",
        cache: false,
		async: false, 
		success: function(data){
			UCGN.disclaimerMatchingJSON = typeof data == "object" ? data : JSON.parse(data);
		}
	});
	
	for( var pagePath in UCGN.disclaimerMatchingJSON ){
		
		if(UCGN.disclaimerMatchingJSON.hasOwnProperty(pagePath)){

			$(document).on( "click", "a[href*='" + pagePath.replace(UCGN.Constant.CONTENT_ROOT_PATH,"") + "']",function(e){
				e.preventDefault();
				var destinationPath	= $(this).attr("href");
				var linkTarget		= $(this).attr("target")
				var disclatimerMap	= new DisclaimerMap();
				
				if(disclatimerMap.isAccepted(destinationPath)){
					//console.log("accepted");
					UCGN.fn.closeDisclaimerWithRedirect(destinationPath,linkTarget);
				
				}else{
					
					disclaimerMatchingKey = $(this)[0].pathname;
					if(disclaimerMatchingKey.indexOf(UCGN.Constant.DAM_ROOT_PATH)==-1 && disclaimerMatchingKey.indexOf(UCGN.Constant.CONTENT_ROOT_PATH)==-1){
						disclaimerMatchingKey = UCGN.Constant.CONTENT_ROOT_PATH + disclaimerMatchingKey;
					}
					
					$.ajax({
						type: 'GET',
						url: UCGN.disclaimerMatchingJSON[disclaimerMatchingKey] + ".content.html",
						dataType: "text",
						success: function (data, textStatus, jqXHR) {
							if(data!=""){
								$('.modal-ajax-content').html(data);
								
								/*-- fixing scrolling issues --*/
								$('.modal-ajax-content').on('show.bs.modal', function (e) {
									$("html").css("overflow-y","hidden");
								});
								$('.modal-ajax-content').on('hidden.bs.modal', function (e) {
									$("html").css("overflow-y","auto");
								});
								
								$('.modal-ajax-content .external-data .ucg_inner_modal').modal("show");
								
								initExternalDisclaimerOptions(pagePath, destinationPath, linkTarget);
							}
						},
						error: function (jqXHR, textStatus, errorThrown) {
							console.log("Can't find disclaimer. Redirecting to direct target.");
							UCGN.fn.closeDisclaimerWithRedirect(destinationPath,linkTarget);
						}
					});
					return false;
				}
			});
		}
	}
};

var initExternalDisclaimerOptions = function(pagePath, destinationPath, linkTarget){
	$('.ucg_disclaimer .ucg_disclaimer_radio').on('click', function () {
		$('.ucg_disclaimer .ucg_disclaimer_radio').removeClass('checked');
		$(this).addClass('checked');
	});

	/* -- disclaimer confirmation -- */
	$(".ucg_disclaimer_button .ucg_button_confirm").on('click', function () {
		if("accept" == $(".ucg_disclaimer .ucg_disclaimer_radio.checked input").val()){
			var disclatimerMap = new DisclaimerMap(); //refreshing table on each creation
			disclatimerMap.addAcceptation(destinationPath);
			UCGN.fn.closeDisclaimerWithRedirect(destinationPath,linkTarget);
			return;
		}
		if("notAccept" == $(".ucg_disclaimer .ucg_disclaimer_radio.checked input").val()){
			var disclatimerMap = new DisclaimerMap(); //refreshing table on each creation
			disclatimerMap.removeAcceptation(destinationPath);
			$('.modal-ajax-content .external-data .ucg_inner_modal').modal("hide");
			$( window ).resize();
			return;
		}
	});
}

