UCGN.fn.contentParsysHeight = function() {
	$(document).ready(function() {
		UCGN.fn.checkBrowser();
		UCGN.fn.setContentParsysHeight();			
		var id;
		$(window).resize(function() {
			clearTimeout(id);
			id = setTimeout(UCGN.fn.setContentParsysHeight, 10);
		});
				
	    var oldHeight = $('.social-footer').height();
	    var newHeight;
	    setInterval(function() {
	        newHeight = $('.social-footer').height();
	        if (oldHeight !== newHeight) {
	            $(window).resize();
	            oldHeight = newHeight;
	        }
	    }, 10);
		
	});
	window.onload = function() {
		$(window).resize();
	};
};

UCGN.fn.setContentParsysHeight = function() {
	if (document.cookie.indexOf('wcmmode') == -1) {
		var isSecure = window.location.protocol == "https://" ? true : false;
		document.cookie='wcmmode=edit;expires=' + new Date(new Date().setDate(new Date().getDate() + 7)) + ';path=/;secure=' + isSecure + ';';
	}
	if ($(window).width() > 750) {
		if (window.location.pathname.indexOf('/uefa/') === -1 && window.location.pathname.indexOf('/uefa.html') === -1) {
			UCGN.fn.setDesktopContentParsysHeight();
		} else {
            if ($('.social-footer').length > 0) {
                $('.social-footer').css({
                    'position': 'relative',
                    'width': '',
                    'padding-bottom': $('#footer').height()+"px"
                });
                $('#updateDate').css('bottom', $('#footer').height());
            } else {
				UCGN.fn.setDesktopContentParsysHeight();
				if ($('.darkBg').length > 0) {
					$('.content-parsys').css('padding-bottom', '');
                }
            }
		}
	} else {
		if ($('.social-footer').length > 0) {
			if ($('.social-footer').next().hasClass('footer')) {
				var socialFooterHeight = $('.social-footer').height();
				var isSetContentParsys = false;
                setInterval(function() {
                	if (!isSetContentParsys) {
                		UCGN.fn.setMobileContentParsysHeight();
                        isSetContentParsys = true;
                	}                	
                    if (socialFooterHeight !== $('.social-footer').height()) {
                    	UCGN.fn.setMobileContentParsysHeight();
                        socialFooterHeight = $('.social-footer').height();
                    }
                }, 10);
			} else {
				UCGN.fn.setMobileContentParsysHeightUEFA();
			}
		} else {
			UCGN.fn.setMobileContentParsysHeightUEFA();
		}
	}
    // background on UEFA pages
	if ($('.darkBg').length > 0) {
		$('#footer').css('position', 'relative');
        if ($(window).width() < 751) {
            // background on UEFA pages for mobile devices
            if (window.location.pathname.indexOf('/uefa/') !== -1 || window.location.pathname.indexOf('/uefa.html') !== -1) {
                $('.content-parsys').css('padding-bottom', '');
            }
        }
	}
	if (typeof CQ !== 'undefined' && typeof CQ.WCM !== 'undefined') {
		UCGN.fn.editMode();
	}
};

UCGN.fn.setDesktopContentParsysHeight = function() {
	$('.social-footer').css('bottom', $('#footer').height() + 'px');		
	var footnoteHeight = 0;
	if ($('#updateDate').length > 0) {
		footnoteHeight = $('#updateDate').height();
		$('#updateDate').css('bottom', (($('#footer').height() || 0) + ($('.social-footer').height() || 0)) + 'px');
	}
	var newHeight = ($('#footer').height() || 0) + ($('.social-footer').height() || 0) + footnoteHeight;
	if($('.content-parsys').length>0) {
        if (Math.abs(newHeight - $('.content-parsys').css('padding-bottom').replace('px', '')) > 1)
            $('.content-parsys').css('padding-bottom', newHeight + 'px');
    }
};

UCGN.fn.setMobileContentParsysHeight = function() {
	UCGN.fn.setDesktopContentParsysHeight();
    $('.social-footer').css({
        'position': 'absolute',
        'width': '100%'
    });
};
	
UCGN.fn.setMobileContentParsysHeightUEFA = function() {
	var footnoteHeight = 0;
	if ($('#updateDate').length > 0) {
		footnoteHeight = $('#updateDate').height();
		$('#updateDate').css('bottom', $('#footer').height() + 'px');
	}
	$('.content-parsys').css('padding-bottom', ($('#footer').height() + footnoteHeight) + 'px');
};

UCGN.fn.editMode = function() {
	if (CQ.WCM.getMode() == 'edit') {
		$('.mainContainer-wrapper').css('min-height', ($(window).height() - ($('.ucgCookieBar').outerHeight() + $('#header').outerHeight())) + 'px');
		if (window.location.pathname.indexOf('/uefa/') === -1 && window.location.pathname.indexOf('/uefa.html') === -1) {
			if ($('.social-footer').length > 0) {
				$('.content-parsys').css('padding-bottom', ($('#updateDate').length > 0 ? ($('#updateDate').height() + 'px') : ''));
				$('#updateDate').css({
					'position': 'relative',
					'bottom': ''
				});
				$('.social-footer').css({
					'position': 'relative',
					'bottom': ''
				});
				$('.footer.base').css('height', $('#footer').height() + 'px');
			}
		}
	}
};

UCGN.fn.checkBrowser = function() {
	var userAgent = navigator.userAgent.toLowerCase();
	if (userAgent.indexOf('firefox') !== -1) {
		$('#mainContainer').attr('data-browser', 'firefox');
	} else {
		$('#mainContainer').attr('data-browser', 'chrome');
	}
};

$(function() {
	if($(".content-parsys.parsys").is(':visible')){
		openLightboxModalIfAvailable($("#mainContainer").data("lightbox"));
	}
	/* ucg_modal.js -> initDisclaimerOptions() - another use of openLightboxModal() for handle disclaimers*/	
});

function openLightboxModalIfAvailable(){
	if($("#mainContainer").data("lightbox")!==undefined){
		$.ajax({
			type: 'GET',
			url: $("#mainContainer").data("lightbox") + ".content.html",
			dataType: "text",
			success: function (data, textStatus, jqXHR) {
				if(data!=""){
					$('.modal-ajax-content').html(data);
					
					/*-- fixing scrolling issues --*/
					$('.modal-ajax-content').on('show.bs.modal', function (e) {
						$("html").css("overflow-y","hidden");
					});
					$('.modal-ajax-content').on('hidden.bs.modal', function (e) {
						$("html").css("overflow-y","auto");
					});
					$('.modal-ajax-content .external-data .ucg_inner_modal').modal("show");
				}
			},
			error: function (jqXHR, textStatus, errorThrown) {
				console.log(textStatus + "\r\nStatus: " + jqXHR.status + "\r\nError: " + errorThrown);
			}
		});
	}
}
UCGN.fn.VideoPlayer = {
    selectors: null,
    _youtubeConfig: [{
        event: 'command',
        func: 'seekTo',
        args: [0, true]
    }, {
        event: 'command',
        func: 'pauseVideo'
    }],
    init: function(pageType) {
        this._selectors = {
            ucgSwiper:          pageType === 'homepage' ? '.ucg_swiper_hp' : '.ucg_swiper',
            ucgSwiperArrow:     pageType === 'homepage' ? '.ucg_swiper_hp_arrow' : '.ucg_swiper_arrow',
            ucgSwiperArrows:    pageType === 'homepage' ? '.ucg_swiper_hp_arrows' : '.ucg_swiper_arrows',
            ucgSwiperTitle:     pageType === 'homepage' ? null : '.ucg_swiper_title',
            ucgSwiperContent:   pageType === 'homepage' ? '.ucg_swiper_hp_content' : '.ucg_swiper_content'
        };
        this.onHpSwiperArrowClick();
        this.onYoutubeThumbnailClick();
        this.onDamThumbnailClick();
    },
    onHpSwiperArrowClick: function() {
        var $scope = this;
        $(document).on('click', $scope._selectors.ucgSwiperArrow, function() {
            var $arrow = $(this),
                $parent = $arrow.parents($scope._selectors.ucgSwiperArrows),
                $swiperContainer = $parent.prev();
            $scope.stopYoutubeVideo($swiperContainer);
            $scope.stopDamVideo($swiperContainer);
        });
    },
    onYoutubeThumbnailClick: function() {
        var $scope = this;
        $(document).on('click', $scope._selectors.ucgSwiper + ' .swiper-slide[data-videotype="youtube"] div.video-player', function() {
            var $player = $(this),
                $parent = $player.parent(),
                $swiperWrapper = $parent.parents('div.swiper-wrapper'),
                uniqueBannerId = $parent.data('uniquebannerid');

            $scope.showYoutubeVideo($parent, true);
            $swiperWrapper.find('div.swiper-slide:not(.swiper-slide-active)[data-uniquebannerid="' + uniqueBannerId + '"]').each(function(index, swiperSlide) {
                $scope.showYoutubeVideo($(swiperSlide), false);
            });
        });
    },
    onDamThumbnailClick: function() {
        var $scope = this;
        $(document).on('click', $scope._selectors.ucgSwiper + ' .swiper-slide[data-videotype="dam"] div.video-player', function() {
            var $player = $(this),
                $parent = $player.parent(),
                $swiperWrapper = $parent.parents('div.swiper-wrapper'),
                uniqueBannerId = $parent.data('uniquebannerid');

            $scope.showDamVideo($parent, true);
            $swiperWrapper.find('div.swiper-slide:not(.swiper-slide-active)[data-uniquebannerid="' + uniqueBannerId + '"]').each(function(index, swiperSlide) {
                $scope.showDamVideo($(swiperSlide), false);
            });
        });
    },
    stopYoutubeVideo: function($hpSwiperSlide) {
        var $scope = this;
        $hpSwiperSlide.find('iframe').each(function(iframeIndex, iframe) {
            $scope._youtubeConfig.forEach(function(command) {
                iframe.contentWindow.postMessage(JSON.stringify(command), '*');
            });
        });
    },
    stopDamVideo: function($hpSwiperSlide) {
        $hpSwiperSlide.find('video').each(function(videoIndex, video) {
            video.pause();
            video.currentTime = 0;
        });
    },
    showYoutubeVideo: function($parent, isActiveSlide) {
        var $scope = this,
            youtubeCode = $parent.data('ytCode');

        $parent.find('img, div.video-player').remove();
        $parent.find($scope._selectors.ucgSwiperContent).css('visibility', 'hidden');
        if ($scope._selectors.ucgSwiperTitle !== null) {
            $parent.find($scope._selectors.ucgSwiperTitle).css('visibility', 'hidden');
        }
        $parent.prepend(
            '<iframe ' +
                'id="yt-ucg-vid-' + youtubeCode + '" ' +
                'frameborder="0" allowfullscreen="1" ' +
                'title="YouTube video player" width="100%" height="100%" ' +
                'src="https://www.youtube.com/embed/' + youtubeCode + '?enablejsapi=1&amp;autoplay=' + (isActiveSlide ? '1' : '0') + '"></iframe>'
        );
    },
    showDamVideo: function($parent, isActiveSlide) {
        var $video = $parent.find('video');

        $parent.find('img, div.video-player').remove();
        $parent.find(this._selectors.ucgSwiperContent).css('visibility', 'hidden');
        if (this._selectors.ucgSwiperTitle !== null) {
            $parent.find(this._selectors.ucgSwiperTitle).css('visibility', 'hidden');
        }
        $video.removeAttr('style');
        $video[0].play();

        setTimeout(function() {
            if (!isActiveSlide) {
                $video[0].pause();
                $video[0].currentTime = 0;
            }
        }, 1000);
    }
};
